import React from "react";
import { useParams } from "react-router-dom";

const WallpaperByTag = () => {
  const { tag } = useParams();
  console.log(tag);
  return (
    <>
      <div className="text-white">Wallpaper By Tag {tag}</div>;
    </>
  );
};

export default WallpaperByTag;
